import React from 'react';

const Stack = () => {
    const text = {
        'text-align': 'center',
        'position': 'relative',
        'top': '50%',
        'left': '50%',
        'margin-right': '-50%',
        'transform': 'translate(-50%, -50%)',
        'color': 'white'
    } 

    return(
        <>
            <h1 style={text}>My Stack</h1>
            <h2 style={text}>My technical stack</h2>
            <div style={{'flex-wrap': 'wrap'}}>

                <img src='https://commons.wikimedia.org/wiki/File:Python-logo-notext.svg'/>

            </div>


        </>
    )
}

export default Stack;
